const DeleteModal = () => {
  return (
    <div className="modal">
      <h1>Delete comment</h1>
      <p>
        Are you sure you want to delete this comment? This will remove the
        comment and can`t be undone.
      </p>
      <button className="cancel">no, cancel</button>
      <button className="delete">yes, delete</button>
    </div>
  );
};
